import React from "react";
import "./App.css";
import Movies from "./components/Movies";
import ListGroup from "./components/ListGroup";

function App() {
  return (
    <main role="main" className="container d-flex bg-danger">
      <ListGroup className="w-50" />
      <div>
        <Movies />
      </div>
    </main>
  );
}

export default App;
